import Navbar from './compon/navbar/navbar.jsx';
import about from './compon/About/About.jsx';
export default class App extends React.Component {
  render() {
    return (
      <div className='container'>
        <Navbar />
        <Box />
        <Box_mini />
        <about/>

      </div>
    )
  }
}
